import React, { useEffect, useState } from 'react';
import { auth } from '../firebase/firebase';
import Donate from './Donate';
import Login from './Login';
import SignUp from './SignUp';

function LoginNav() {
    return (
        <div className='LoginNav'>
            <Login />
            <SignUp />
            <Donate />
      </div>
  )
}

export default LoginNav;
